  \"environmental-assessment-for-proposed-hunting-plan-for-sherburne-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Fish and Wildlife Service
  proposes to provide additional hunting opportunities on Sherburne National Wildlife
  Refuge in Zimmerman, Minnesota that are compatible with the purpose of the Refuge.
  This environmental assessment evaluates three possible alternatives for hunting
  opportunities. The preferred alternative would offer compatible hunting opportunities
  while providing non-hunting visitors with other priority public use opportunities
  (i.e., wildlife observation, wildlife photography, environmental education and interpretation).\",\n\t\"license_title\":
